Yes, it's possible to import a single `const` method from a helper file in TypeScript without importing other methods. By using the `import { methodName } from 'moduleName'` syntax, you can selectively import only the method you need.

However, if you find that the generated JavaScript code is still including all the exported methods from the helper file, it might be due to how the build tool (e.g., Webpack, Rollup, or TypeScript's native compiler) is configured.

To ensure that only the selected method is included in the generated JavaScript file, you can use a feature called "tree shaking" provided by modern build tools. Tree shaking helps in removing unused exports from the final bundle.

For TypeScript native compiler, you can use `tsc` with `esModuleInterop` and `moduleResolution` set to `node` in your `tsconfig.json`:

```json
{
  "compilerOptions": {
    "esModuleInterop": true,
    "moduleResolution": "node",
    \/\/ ...other options
  }
}
```

Additionally, use an appropriate build tool like Rollup or Webpack with tree shaking enabled. For example, in Rollup:

```json
{
  "input": "src\/index.ts",
  "output": {
    "file": "dist\/bundle.js",
    "format": "cjs",
    "sourcemap": true
  },
  "plugins": [rollup_plugin_typescript2(), commonjs(), resolve(), builtins(), nodeResolve(), terser()]
}
```

The plugins used in this Rollup configuration offer tree shaking, ensuring that only the required method is included in the final JavaScript bundle.

After setting up your build tool, ensure that you're importing the method as a default import in the file where you want to use it:

```typescript
\/\/ In your helper file
export const methodA = () => { \/* ... *\/ };
export const methodB = () => { \/* ... *\/ };

\/\/ In the file where you want to use methodA
import methodA from '.\/helper';
methodA();
```

With tree shaking enabled, the generated JavaScript code should only contain the required method.

