        const char* basePath = SDL_GetBasePath();
        if (basePath) {
            printf("Currently running program: %s\n", basePath);
            SDL_free(basePath);
        } else {
            printf("Failed to get base path!\n");
        }
    }

    SDL_Quit();
    return 0;
}
```

This example uses SDL\_GetBasePath() to get the base path of the application and then prints it out. Note that you should free the returned string using SDL\_free() when you are done with it.

Keep in mind that SDL\_GetBasePath() returns the base path of the application, which may not necessarily be the same as the directory containing the currently running program, especially if the working directory has been changed. However, it should give you a good indication of the location of the application.

