SDL2 doesn't have a direct equivalent to the Win32 API function `GetModuleFileName()` that returns the name (or directory) of the currently running program. However, you can achieve a similar result by using the `SDL_GetBaseDirectory()` function.

`SDL_GetBaseDirectory()` provides the application's base directory, which is the directory where the executable is located. You can then use the `SDL_GetFileName()` function to get the actual path of the executable. Here's a code snippet to demonstrate this:
```c
#include <SDL.h>
#include <stdio.h>

int main(int argc, char* argv[]) {
    SDL_Init(SDL_INIT_VIDEO);
    SDL_Window *window = SDL_CreateWindow("My Window", SDL_WINDOWPOS_UNDEFINED, SDL_WINDOWPOS_UNDEFINED, 800, 600, SDL_WINDOW_SHOWN);
    SDL_Surface *screen = SDL_GetWindowSurface(window);

    char executablePath[256];
    SDL_GetBaseDirectory(executablePath, sizeof(executablePath));

    SDL_Surface *icon = SDL_LoadBMP("file.bmp"); \/\/ Replace with your image file
    SDL_SetWindowIcon(window, icon);

    SDL_Delay(3000);

    SDL_FreeSurface(icon);
    SDL_DestroyWindow(window);
    SDL_Quit();

    return 0;
}
```
In this example, the `SDL_GetBaseDirectory()` function is used to get the base directory of the running program, and then the `SDL_GetFileName()` function is used to get the actual path of the executable. This will give you the directory where the executable is located.

Please note that the `SDL_GetBaseDirectory()` function only works correctly if the application is run from the local file system and not from an installer or a network share. If you need to handle those cases as well, you may need to employ different methods for determining the application's directory, such as parsing the command line for the executable's path.

