Sure, here is an implementation of an Event class in Python that can be connected, disconnected, and emitted:
```python
class Event:
    def __init__(self):
        self.listeners = []

    def connect(self, listener):
        self.listeners.append(listener)

    def disconnect(self, listener):
        if listener in self.listeners:
            self.listeners.remove(listener)

    def emit(self, *args, **kwargs):
        for listener in self.listeners:
            listener(*args, **kwargs)
```
In this implementation, the `Event` class has three methods: `connect()`, `disconnect()`, and `emit()`. The `connect()` method adds a listener to the event. The `disconnect()` method removes a listener from the event. The `emit()` method triggers all the listeners, passing any provided arguments along to them.

