        target[key] = value;
        this.saveToStorage();
        return true;
      }
    });
  }

  get value() {
    return this.storageProxy; 
  }

  private saveToStorage() {
    localStorage.setItem(this.storageKey, JSON.stringify(this.storageProxy));
  }

}
