Certainly! Smart pointers in C++ are template classes that provide automatic memory management for dynamically allocated objects, helping to prevent memory leaks and simplify code. Here are some basic examples of the most commonly used smart pointers:

1. `std::unique_ptr`

The `std::unique_ptr` is a smart pointer that represents exclusive ownership of a dynamically allocated object. Only one `std::unique_ptr` can own an object at a time. When the `std::unique_ptr` goes out of scope, it automatically deletes the object it owns.

Here's a simple example:

```cpp
#include <memory>
#include <iostream>

struct MyObject {
    MyObject() { std::cout << "MyObject constructed.\n"; }
    ~MyObject() { std::cout << "MyObject destroyed.\n"; }

    void printMessage() { std::cout << "Hello from MyObject!\n"; }
};

int main() {
    \/\/ Create a unique_ptr to manage the dynamically allocated MyObject
    std::unique_ptr<MyObject> myObjPtr(new MyObject());

    \/\/ Call a method on the MyObject through the unique_ptr
    myObjPtr->printMessage();

    return 0;
}
```

Output:

```
MyObject constructed.
Hello from MyObject!
MyObject destroyed.
```

2. `std::shared_ptr`

The `std::shared_ptr` is a smart pointer that represents shared ownership of a dynamically allocated object. Multiple `std::shared_ptr` instances can own the same object, and the object will be deleted only when the last `std::shared_ptr` goes out of scope.

Here's a simple example:

```cpp
#include <memory>
#include <iostream>
#include <vector>

struct MyObject {
    MyObject() { std::cout << "MyObject constructed.\n"; }
    ~MyObject() { std::cout << "MyObject destroyed.\n"; }

    void printMessage() { std::cout << "Hello from MyObject!\n"; }
};

int main() {
    \/\/ Create a shared_ptr to manage the dynamically allocated MyObject
    std::shared_ptr<MyObject> myObjPtr(new MyObject());

    \/\/ Create a vector of shared_ptrs, sharing ownership of the MyObject
    std::vector<std::shared_ptr<MyObject>> myObjPtrs;
    myObjPtrs.push_back(myObjPtr);
    myObjPtrs.push_back(myObjPtr);

    \/\/ Call a method on the MyObject through the shared_ptr
    myObjPtr->printMessage();

    return 0;
}
```

Output:

```
MyObject constructed.
Hello from MyObject!
MyObject destroyed.
```

3. `std::weak_ptr`

The `std::weak_ptr` is a smart pointer that does not own a dynamically allocated object but can refer to an object managed by a `std::shared_ptr`. `std::weak_ptr` does not prevent the managed object from being destroyed, allowing for the detection of circular references and avoiding memory leaks.

Here's a simple example:

```cpp
#include <memory>
#include <iostream>

struct MyObject {
    MyObject() { std::cout << "MyObject constructed.\n"; }
    ~MyObject() { std::cout << "MyObject destroyed.\n"; }

    void printMessage() { std::cout << "Hello from MyObject!\n"; }
};

int main() {
    \/\/ Create a shared_ptr to manage the dynamically allocated MyObject
    std::shared_ptr<MyObject> myObjPtr(new MyObject());

    \/\/ Create a weak_ptr referring to the MyObject managed by the shared_ptr
    std::weak_ptr<MyObject> myObjWeakPtr(myObjPtr);

    \/\/ Check if the weak_ptr is still valid (i.e., the MyObject hasn't been destroyed)
    if (auto sharedMyObjPtr = myObjWeakPtr.lock()) {
        \/\/ Call a method on the MyObject through the shared_ptr
        sharedMyObjPtr->printMessage();
    }

    return 0;
}
```

